
/*************************************************************************

To extract image urls from keyboard of BNP : run the following script in
the console of the login web page of BNP (this is the same script as in bank.service.ts / BNP) :

Note : images are always identical so their Hash should be enough, BUT : when the browser downloads
the keyboard image, then the canvas is the only way to get the raw data (dataurl). And this method
returns differents results on different browsers. This difference is enven used to finger print
browsers... That's why we have to ocr images for BNP...

    // get the keyboard image
    const keyboardEl = document.querySelector("#secret-nbr-keyboard");
    const style = window.getComputedStyle(keyboardEl);
    const imgUrl = style.backgroundImage.slice(4, -1).replace(/"/g, "")
    const img = new Image()
    img.src = imgUrl;
    const promise = new Promise((resolve)=>{
      img.onload = resolve
    })
    await promise;

    // split into an image for each key and compute its hash

    //* Image geometry
    const
      X0 = 3,
      Y0 = 2,
      IMG_W = 77 - 28 - 27, // 22 px
      IMG_H = 75 - 21 - 22, // 32 px
      STEP_X = 86-X0,
      STEP_Y = 82-Y0;

    //* canvas
    const canvasForKeys = document.createElement("canvas");
    canvasForKeys.width = 22;
    canvasForKeys.height = 32;
    const ctxForKeys = canvasForKeys.getContext('2d');

    //* ************************************************************************
    //* the keyboard is a single image, we have to split it into an image
    //* for each key and run ocr
    //* ************************************************************************
    const dataUrls = [];
    for (let j = 0; j < 2; j++) {
      for (let i = 0; i < 5; i++) {
        const x = X0 + i * STEP_X;
        const y = Y0 + j * STEP_Y;
        ctxForKeys.drawImage(img, x + 28, y + 21, IMG_W, IMG_H, 0, 0, 22, 32) // all key images must be 22*32 to be ocr-ized
        dataUrls.push(canvasForKeys.toDataURL())
      }
    }
    console.log("\ndataUrls");
    console.log(dataUrls);

**************************************************************************/
